
<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>Scarlet Fuenmayor | AEGIS Protocol</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@700&family=Rajdhani:wght@500;700&display=swap');
        :root { --cyan: #00f2ff; --pink: #ff00ff; --bg: #000; }
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body { background: var(--bg); color: #fff; font-family: 'Rajdhani', sans-serif; display: flex; justify-content: center; min-height: 100vh; overflow-x: hidden; }

        #loader { position: fixed; inset: 0; background: #000; z-index: 1000; display: flex; flex-direction: column; align-items: center; justify-content: center; cursor: pointer; }
        .loading-text { font-family: 'Orbitron'; color: var(--cyan); font-size: 1.6rem; letter-spacing: 4px; text-shadow: 0 0 15px var(--cyan); }
        .sub-text { color: var(--pink); font-family: 'Orbitron'; font-size: 0.8rem; margin-top: 20px; animation: blink 1s infinite; }

        .main-content { display: none; opacity: 0; transition: 2s ease; width: 100%; max-width: 450px; padding: 20px; text-align: center; }

        /* ESCÁNER LÁSER */
        .header-shield { position: relative; display: flex; align-items: center; justify-content: center; gap: 15px; margin: 30px auto; width: fit-content; }
        .frame { border-radius: 50%; border: 2px solid var(--cyan); overflow: hidden; position: relative; z-index: 5; box-shadow: 0 0 15px rgba(0,242,255,0.3); }
        .f-logo { width: 80px; height: 80px; border-color: var(--pink); }
        .f-photo { width: 130px; height: 130px; }
        .laser-line { position: absolute; width: 140%; height: 2px; background: var(--cyan); box-shadow: 0 0 15px var(--cyan); left: -20%; z-index: 20; animation: scanMove 4s infinite linear; }

        @keyframes scanMove { 0% { top: 0%; opacity: 0; } 10% { opacity: 1; } 90% { opacity: 1; } 100% { top: 100%; opacity: 0; } }

        h1 { font-family: 'Orbitron'; font-size: 1.5rem; color: var(--cyan); margin-bottom: 5px; text-shadow: 0 0 10px var(--cyan); }
        
        /* TÍTULOS DE ROL */
        .roles { font-family: 'Orbitron'; font-size: 0.7rem; color: #fff; letter-spacing: 2px; margin-bottom: 5px; text-transform: uppercase; }
        .service-tag { font-family: 'Orbitron'; font-size: 0.55rem; color: var(--cyan); border: 1px solid var(--cyan); padding: 2px 10px; border-radius: 10px; display: inline-block; margin-bottom: 15px; opacity: 0.8; }
        
        .phrase { color: var(--pink); font-size: 0.65rem; font-family: 'Orbitron'; margin-bottom: 25px; letter-spacing: 1px; }

        .card { background: rgba(255,255,255,0.02); padding: 20px; border-radius: 15px; border: 1px solid rgba(0,242,255,0.1); }
        
        /* ESTILO FORMULARIO */
        label { display: block; text-align: left; font-size: 0.7rem; color: var(--cyan); margin-left: 5px; font-family: 'Orbitron'; }
        input, textarea { width: 100%; padding: 15px; margin: 5px 0 15px 0; background: #0a0a0a; border: 1px solid #333; color: var(--cyan); border-radius: 8px; font-size: 1.1rem; outline: none; }

        .btn-wa { width: 100%; height: 65px; background: var(--cyan); color: #000; font-family: 'Orbitron'; font-weight: 700; border: none; border-radius: 35px; font-size: 1.5rem; letter-spacing: 2px; cursor: pointer; margin-top: 10px; box-shadow: 0 0 25px rgba(0,242,255,0.5); }
        .btn-mail { width: 100%; padding: 12px; background: transparent; color: var(--pink); border: 1px solid var(--pink); border-radius: 35px; margin-top: 20px; font-family: 'Orbitron'; font-size: 0.8rem; cursor: pointer; }

        @keyframes blink { 50% { opacity: 0; } }
    </style>
</head>
